import React from 'react';
import Media from 'react-bootstrap/Media'
class catgory extends React.Component{
    render(){
        return(
            <div >
    <ul className="list-unstyled">
            <Media as="li">
            <img
            width={64}
            height={64}
            className="mr-3"
            src="https://cf3.s3.souqcdn.com/item/2018/07/24/36/70/84/01/item_L_36708401_143817431.jpg"
            alt="Generic placeholder"
            />
            <Media.Body>
            <h5>Iphone</h5>
            <p>
            Details
            </p>
            </Media.Body>
            </Media>

            </ul>
            </div>

        )
    }
}
export default catgory;
